import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "../Home";
import Topbar from "../../component/Topbar";
import Sidebar from "../../component/Sidebar";

function App() {
  return (
    <div className="App">
      <div class="row">
        <div class="col-sm-2">
          <Sidebar />
        </div>
        <div class="col-sm-10">
          <Topbar />
        </div>
      </div>
    </div>
  );
}

export default App;
